import React from "react";
import "./App.css";
import Header from "./components/header";

const images = require.context('./assets', true, /\.png$/);
const imagePath = (name) => images(name, true);

function App() {
  return (
    <div className="main">
      <Header />
      <div className="body">
        <div className="left">
          <section className="about">
            <article>
              <h2>About Me</h2>
              <p>
                Salut c'est moi !
              </p>
            </article>
          </section>

          <section className="projects">
            <h2>Mes projets</h2>
            <article>
              <h3>Bataille navale</h3>
              <img src="../public/navy.png" alt="slug" style={{width: "200px", height: "200px"}}/>
              <p>
                Jeu de bataille navale en ligne
              </p>
            </article>
          </section>
          </div>
      </div>
    </div>
  );
}

export default App;
